    name: string;
    description: string;
    checked: boolean;
  };
interface TodoListProps {
  todos: Todo[];
}

const TodoList: React.FC<TodoListProps> = ({ todos }) => {
  return (
    <div>
      {todos.map((todo) => {
        <div></div>
